angular.module('starter', ['ionic', 'firebase', 'ngMap', 'ngIOS9UIWebViewPatch', 'starter.controllers', 'starter.services', 'starter.directives'])

.run(function($ionicPlatform, $rootScope, $window, $ionicLoading, $ionicPopup, Settings, $state, $ionicHistory) {

    var onPrepareRender = function() {}
    var configuration = function() {
        // for more options see `paypal-mobile-js-helper.js`
        var config = new PayPalConfiguration({
            merchantName: "Chow App",
            merchantPrivacyPolicyURL: "https://mytestshop.com/policy",
            merchantUserAgreementURL: "https://mytestshop.com/agreement"
        });
        return config;
    }
    var onPayPalMobileInit = function() {
        PayPalMobile.prepareToRender("PayPalEnvironmentNoNetwork", configuration(), onPrepareRender);
    }
    var initPaymentUI = function() {
        var clientIDs = {
            "PayPalEnvironmentProduction": "AUHse3M1-1piQBKeBT0iT4qG9f0qZbh4jAloGC7TdQQ2kPEz65-aXkECuBJm2OeIHi9tjcaGCR6qpOaF",
            "PayPalEnvironmentSandbox": "AVznq-q-XbzKxILtlT1310cCqcreDnn7Zm3w4_aM38XO3w5iXgJS6UQpKlFErw2-FDRbmOdNiBo3gOG-"
        };
        PayPalMobile.init(clientIDs, onPayPalMobileInit);

    }

    $ionicPlatform.ready(function() {
        if (window.cordova && window.cordova.plugins.Keyboard) {
            cordova.plugins.Keyboard.hideKeyboardAccessoryBar(false);
        }
        if (window.StatusBar) {
            StatusBar.styleDefault();
        }
        if (typeof(PayPalMobile) != "undefined")
            initPaymentUI();

        $rootScope.logochowapp = "data:image/png;base64,";
    });
    $rootScope.$on('$locationChangeStart', function(event, next, current) {

        $ionicHistory.clearCache();
    });
    $rootScope.$on('$stateChangeStart', function(event, toState, toParams, fromState, fromParams) {
        $ionicHistory.clearCache();

    });
    $rootScope.$on('$stateChangeSuccess', function(event, toState, toParams, fromState, fromParams) {
        if (toState.url != "/login" && toState.url != "/forgot" && toState.url != "/register" && !$rootScope.currentUser) {
            $state.go("introduce");
        }

        if (toState.url == "/introduce" ||
            toState.url == "/forgot" ) {
            $rootScope.ishidenfooterbar = true;

            $rootScope.ishidenback = true;

        } else {
            if (toState.url == "/checkout" || toState.url == "/paymentmethod" 
                || toState.url == "/paypal" || toState.url == "/creditcard" 
                || toState.url == "/register" || toState.url == "/login") {
                $rootScope.ishidenfooterbar = true;
            } else {
                $rootScope.ishidenfooterbar = false;
            }

            if (toState.url == "/home") {
                $rootScope.ishidenback = true;
            } else {

                $rootScope.ishidenback = false;
            }
        }
        if (toState.url == "/map") {
            $rootScope.nextpage = "#/paymentmethod";
            $rootScope.ismappage = true;
        } else {
            $rootScope.ismappage = false;
        }
    })
    $rootScope.show = function(text) {
        $rootScope.loading = $ionicLoading.show({
            template: text ? text : 'Loading...',
            animation: 'fade-in',
            showBackdrop: true,
            maxWidth: 500,
            showDelay: 0
        });
    };
    $rootScope.hide = function() {
        $ionicLoading
            .hide();
    };
    $rootScope.longnotify = function(text) {
        $rootScope.show(text);
        $window.setTimeout(function() {
            $rootScope.hide();
        }, 2999);
    };
    $rootScope.quicknotify = function(text) {
        $rootScope.show(text);
        $window.setTimeout(function() {
            $rootScope.hide();
        }, 999);
    };
    $rootScope.confirm = function(title, text) {
        var confirmPopup = $ionicPopup.confirm({
            title: title,
            template: text
        });
        return confirmPopup;
    };
})

.config(function($stateProvider, $urlRouterProvider) {
    $stateProvider
    // .state('app', {
    //   url: "/app",
    //   abstract: true,
    //   templateUrl: "templates/home.html",
    //   controller: 'AppCtrl'
    // })
        .state('introduce', {
            url: '/introduce',
            templateUrl: "templates/introduce.html",
            controller: 'IntroduceController'
        })
        .state('home', {
            url: '/home',
            templateUrl: "templates/home.html",
            controller: 'HomeController'
        })
        .state('catalog', {
            url: '/catalog',
            templateUrl: "templates/catalog.html",
            controller: 'CategoryController'
        })
        .state('search', {
            url: '/search',

            templateUrl: "templates/search.html",
            controller: 'SearchController'

        })
        .state('category', {
            url: "/category/:categoryId",

            templateUrl: "templates/catalog.html",
            controller: 'CategoryController'

        })
        .state('restaurant', {
            url: "/restaurant/:restaurantid",

            templateUrl: "templates/restaurant.html",
            controller: 'RestaurantController'

        })
        .state('cart', {
            url: '/cart',

            templateUrl: "templates/cart.html",
            controller: 'CartController'

        })
        .state('map', {
            url: '/map',

            templateUrl: "templates/map.html",
            controller: 'MapController'

        })
        .state('paymentmethod', {
            url: '/paymentmethod',
            templateUrl: "templates/paymentmethod.html",
            controller: 'PaymentMethodController'

        })
        .state('paypal', {
            url: '/paypal',
            templateUrl: "templates/paypal.html",
            controller: 'PaypalController'

        })
        .state('creditcard', {
            url: '/creditcard',
            templateUrl: "templates/creditcard.html",
            controller: 'CreditCardController'

        })
        .state('checkout', {
            url: '/checkout',
            templateUrl: "templates/checkout.html",
            controller: 'CheckoutController'

        })
        .state('paymentsuccess', {
            url: '/paymentsuccess',
            templateUrl: "templates/paymentsuccess.html",
            controller: 'PaymentSuccessController'

        })
        .state('login', {
            url: '/login',

            templateUrl: 'templates/login.html',
            controller: 'LoginController'

        })
        .state('register', {
            url: '/register',

            templateUrl: 'templates/register.html',
            controller: 'RegisterController'

        })
        .state('forgot', {
            url: '/forgot',
            templateUrl: 'templates/forgotPassword.html',
            controller: 'ForgotPasswordController'

        })
        .state('updateprofile', {
            url: '/updateprofile',

            templateUrl: 'templates/updateprofile.html',
            controller: 'UpdateProfileController'

        })
        .state('profile', {
            url: '/profile',

            templateUrl: 'templates/profile.html',
            controller: 'ProfileController'

        });

    $urlRouterProvider.otherwise('introduce');
});
